javascript:(()=>{let e=document.querySelector('[data-testid="issue.views.issue-base.foundation.breadcrumbs.current-issue.item"]');if(console.log(e.href),!e){alert("No issue found. Make sure you are looking at a specific Jira issue.");return}let i=e.href.match(/\/browse\/(.*)/)[1],r=`[${i}](${e.href})`;navigator.clipboard.writeText(r).then(()=>{console.log("Copied to clipboard: ",r)})})();